void	RB_Printer()
{
	static char	*stages = "RgBrGb";
	static int	rgb[3] = {0, 255, 0};
	static char	changer = 0;

	switch(stages[changer % 6]){
		case 'R': rgb[0] += 256 / RB_SPEED; rgb[0] > 255 ? (rgb[0] = 255): changer--; break;
		case 'r': rgb[0] -= 256 / RB_SPEED; rgb[0] < 0 ? (rgb[0] = 0): changer--; break;
		case 'G': rgb[1] += 256 / RB_SPEED; rgb[1] > 255 ? (rgb[1] = 255): changer--; break;
		case 'g': rgb[1] -= 256 / RB_SPEED; rgb[1] < 0 ? (rgb[1] = 0): changer--; break;
		case 'B': rgb[2] += 256 / RB_SPEED; rgb[2] > 255 ? (rgb[2] = 255): changer--; break;
		case 'b': rgb[2] -= 256 / RB_SPEED; rgb[2] < 0 ? (rgb[2] = 0): changer--; break;
	}
	changer = (changer + 1) % 6;
	printf("\e[38;2;%i;%i;%im", rgb[0], rgb[1], rgb[2]);
}

int		outerSize(char** array)
{
	int i = 0;
	while (array[i])
		i++;
	return(i);
}

int main(int argc, char **argv)
{
	char **frames = g_Rick;

	if (argc == 2) {
		switch (argv[1][0]) {
			case 'g' : (void)frames;
			case '1' : frames = g_Gandalf;break;
			case 'k' : (void)frames;
			case '2' : frames = g_Knot;break;
			case 'r' : (void)frames;
			case '3' : frames = g_Rick;break;
			case 'b' : (void)frames;
			case '4' : frames = g_Batman;break;
			case 's' : (void)frames;
			case '5' : frames = g_Spidey;break;
			default : (void)frames;break;
		}
	}
	int framecount = outerSize(frames);
	for (int i = 0; 42; i = (i + 1) % framecount)
	{
		RB_Printer();
		printf("\e[1;1H\e[2J\e[1m%s", frames[i]);
		usleep(DELAY);
	}
}